import React, { Component } from "react";
import UserConsumer from "../context";
import TableC from "../components/TableC"

class Users extends Component {
  render() {
    return (
      <UserConsumer>
        {(value) => {
          return (
            <div>
              {value.users.map((user) => {
                return (
                  <TableC
                    key={user.id}
                    id={user.id}
                    name={user.name}
                    jobTitle={user.jobTitle}
                    salary={user.salary}
                  />
                );
              })}
            </div>
          );
        }}
      </UserConsumer>
    );
  }
}

export default Users;
